import React from 'react';
import './cart.scss';

const Cart = () => {
  const [open, setOpen] = React.useState(false);
  return (
    <div>
      <div className="App-modal">
        <li className="btnPlay" onClick={() => setOpen(true)}>
          <h4>Відео огляд товару</h4>
        </li>
        <Modal open={open} setOpen={setOpen}>
          <h1>xxx</h1>
          <h2></h2>
        </Modal>
      </div>
    </div>
  );
};

export default Cart;
